import mixin from 'blockchain-ui-privatization/PC/common-mixin/broker/view/view';
import 'blockchain-ui-privatization/PC/common-mixin/broker/view/view.styl';
import {
  getCoinShowName,
} from 'blockchain-ui-privatization/utils';

export default {
  mixins: [mixin],
  mounted() {
    this.init();
  },
  computed: {
    columns() {
      return [
        {
          title: this.$t('broker.time'),
          width: '100px',
        },
        {
          title: this.$t('broker.scale'), // '返佣比例',
        },
        {
          title: `${this.$t('broker.fee')}`,
        },
        {
          title: `${this.$t('broker.amount')}(${getCoinShowName(this.bonusCoinName, this.coinList)})`,
        },
      ];
    },
  },
};
